import react from 'react';

const EducationItem = ({date, degree, location, gpa, href}) => {

  return (
    <li className="education__item">
      <span className='education__date'> {date}: </span>
      <a 
        href={href}
        className='education__degree skills-popup__link-text skills__title--animating'
        target='_blank'
        rel='noreferrer'
      > 
        {deg}
      </a>
      <span className='education__location'> from the University of Minnesota Twin Cities  </span>
      <span className='education__gpa'> ({gpa} GPA). </span>
    </li>
  )
}
